// Default imports
import React from 'react';

// Custom imports
import './home.scss';
import {NavLink} from "react-router-dom";
import * as ReactIcon from 'react-icons/md';

const Home = (routeProp) => {
    const icon = ReactIcon['MdLink'];
    console.log(routeProp.pi);
    return (
        // HTML here
        <div className='bg'>
            <div className="contentCenter">
                <div className='fontSize'>
                    Hey, I'm <b> Panchal</b>.<br/>
                    I'm a full-stack web developer.
                </div>
                <br/>
                <NavLink to='/about' className="waves-effect waves-light btn-flat white">
                    Find out more.
                    <icon/>
                </NavLink>
            </div>
        </div>
    )
};

// Default export
export default Home;
